#include <iostream>
#include<string>

#include <bits/stdc++.h>

using namespace std;
bool same(string s)
{int n = s.length(); 
    for (int i = 1; i < n; i++) 
        if (s[i] != s[0]) 
            return false; 
  
    return true;
}
long substrCount(int n, string s)
 { int count =0;
for(int i =0;i<n;i++)
{
  if(s[i]==s[i+2])
  {
      count ++;
  }
  if(s[i]==s[i+1] )
  {
  	count ++;
  	
  }
 
}
  if(same(s))
   { 
   	count++;
   }
return (n+count);
}

int main()
{ string s("");
cout<<substrCount(s.length(),  s);
}
